import React from 'react';
import { useState } from "react"
import "./Filter.css";
import Button from '@mui/material/Button';
import MenuItem from '@mui/material/MenuItem';
import Select from '@mui/material/Select';
import { DesktopDatePicker } from '@mui/x-date-pickers/DesktopDatePicker';
import dayjs from 'dayjs';
import TextField from '@mui/material/TextField';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import { AdapterDayjs } from '@mui/x-date-pickers/AdapterDayjs';
import FavoriteBorderIcon from '@mui/icons-material/FavoriteBorder';
import BedIcon from '@mui/icons-material/Bed';


const Filter = () => {
    const [location, setLocation] = useState("India");
    const [price, setPrice] = useState("500-2500");
    const [propertyType, setPropertyType] = useState("Houses");
    const [date, setDate] = useState(dayjs('2014-08-18T21:11:54'));

    const handleDateChange = (newValue) => {
        setDate(newValue);
        console.log(newValue.$d);
    };

    const handleChange = (event) => {
        setLocation(event.target.value);
    };

    const handlePriceChange = (event) => {
        setPrice(event.target.value);
    };

    const handlePropertyChange = (event) => {
        setPropertyType(event.target.value)
    }

    return (
        <>
            <div className="filter">
                <div className="location flex border width">
                    <p className="filter-name ">Location</p>
                    <div className="selection">
                        <Select
                            value={location}
                            onChange={handleChange}
                            className="select-container"
                        >
                            <MenuItem value="India">India</MenuItem>
                            <MenuItem value="USA">USA</MenuItem>
                            <MenuItem value="China">China</MenuItem>
                        </Select>
                    </div>
                </div>
                <div className="date flex border width">
                    <p className="filter-name ">When</p>
                    <div className="selection">
                        <LocalizationProvider dateAdapter={AdapterDayjs}>
                            <DesktopDatePicker
                                inputFormat="MM/DD/YYYY"
                                value={date}
                                onChange={handleDateChange}
                                renderInput={(params) => <TextField {...params} />}
                                className="select-date-container"
                            />
                        </LocalizationProvider>
                    </div>
                </div>
                <div className="price flex border width">
                    <p className="filter-name ">Price</p>
                    <div className="selection">
                        <Select
                            value={price}
                            onChange={handlePriceChange}
                            className="select-container"
                        >
                            <MenuItem value="500-2500">$500-2500</MenuItem>
                            <MenuItem value="2501-4500">$2500-4500</MenuItem>
                            <MenuItem value="4501-7000">$4500-7000</MenuItem>
                        </Select>
                    </div>
                </div>
                <div className="property-type flex border width">
                    <p className="filter-name">Property Type</p>
                    <div className="selection">
                        <Select
                            value={propertyType}
                            onChange={handlePropertyChange}
                            className="select-container"
                        >
                            <MenuItem value="Houses">Houses</MenuItem>
                            <MenuItem value="Luxury">Luxury</MenuItem>
                            <MenuItem value="Apartment">Apartment</MenuItem>
                        </Select>
                    </div>
                </div>
                <div className="search-btn flex border width">
                    <Button size="small" variant="contained" className="search">Search</Button>
                </div>
            </div>


            <div className="filter-grid">
                <div className="card">
                    <span className="card-ribbon"></span>
                    <p className="span-content">POPULAR</p>
                    <div className="card-img">
                        <img src="http://4.bp.blogspot.com/-vO0XXtoTrqQ/UZZEw26zzmI/AAAAAAAAAsY/tUt0TedjTEk/s1600/1.png" />
                    </div>
                    <div className="card-content">
                        <div className="card-top-content">
                            <div className="card-price-address">
                                <div>
                                    <span className="price">$2,508{" "}</span>
                                    <span className="per-month">/month</span>
                                </div>
                                <div>
                                    <span className="city">Palm Harbor</span>
                                </div>
                            </div>
                            <div className="card-favourite">
                                <FavoriteBorderIcon fontSize="small" style={{ color: "mediumslateblue" }} />
                            </div>
                        </div>
                        <span className="address">2699 Green Valley, Highland Lake,FL</span>
                        <hr className="divider" />
                        <div className="card-bottom-content">
                            <div className="bed bottom-flex">
                                <BedIcon className="icon" />
                                <span>Beds</span>
                            </div>
                            <div className="bath bottom-flex">
                                Bathrooms
                            </div>
                            <div className="area bottom-flex">
                                Area
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Filter




